  name: string;
  valor: string;
}

function Title(props: TitleProps) {
  return (
    <h1>Ol√° {props.name} {props.valor} </h1>
  )
  }

function App() {
  return (
    <div className="App">
      <Title name="Texto 1" valor="5" />
      <h1>Hello World</h1>
    </div>
  );
}

export default App;
